import './Account.css'
import moment from 'moment'

const ContactUs = () => {
    let date = moment().format('YYYYMMDD h:mm:ss')
    return(
        <div>
            <div>Contact Us</div>
            <div>Name: </div>
            <div>Email: </div>
            <div>Message: </div>
            <div><button></button></div>
        </div>
    )
}

export default ContactUs
